import React from 'react'
import {MemoryRouter, Route, Link} from 'react-router-dom'
import Splash from './components/Splash';


const App = () => {
  return (
    <MemoryRouter>
      <div>
        <Route path='/' component={Splash}/>
      </div>
    </MemoryRouter>
  );
};
export default App;
